import React, { useEffect, useState} from 'react';
import {Link} from 'react-router-dom';
import Navbar from './Navbar';
import useHttpGet from '../hooks/httpGet';

function Dashboard() {
//define the states
  const stocks = useHttpGet('http://localhost:5000/api/stocks',[]);
  const users = useHttpGet('http://localhost:5000/api/users', []);


  return(
    <div>
      <Navbar/>
      <h1>Dashboard</h1>
     
      
      <div>
        {/*map through the pokemon and display them on screen a certain way.
        Link is there to allow me to click on a name and bring it to more detail. */}
      {stocks.map(stock => (
        <p key={stock.name}>
          {stock.name}
          
        </p>
      ))}
      {users.map(user => (
        <p key={user.username}>
          {user.username}
        </p>
      ))}
      </div>
    </div>

  );
}

export default Dashboard;
